import React, { useState, useEffect } from "react";
import axios from "axios";
import minimalist5 from "../assets/minimalist5.jpg";
import { useNavigate } from "react-router-dom";
import Texthome_1 from "./Texthome-1";

export default function TP1() {
  const [id, setId] = useState("");
  const [pername, setPername] = useState("");
  const [quantity, setQuantity] = useState("");
  const [price, setPrice] = useState("");
  const [dameg, setDameg] = useState("");
  const navigate = useNavigate();

  useEffect(() => {
    if (!localStorage.getItem("userID")) {
      navigate("/");
    }
  }, []);

  const [alertMessage, setAlertMessage] = useState("");
  const [alertType, setAlertType] = useState("");

  useEffect(() => {
    if (alertMessage) {
      const timeout = setTimeout(() => {
        setAlertMessage("");
      }, 4000);

      return () => clearTimeout(timeout);
    }
  }, [alertMessage]);

  // Fetch data from API and set pername state
  useEffect(() => {
    const fetchData = async () => {
      try {
        const response = await axios.get("/api/get-username/:userID");
        const username = response.data.username;
        setPername(username); // Set pername state with the fetched value
      } catch (error) {
        console.error("Error fetching username:", error);
      }
    };

    fetchData(); // Call the fetchData function when component mounts
  }, []); // Empty dependency array ensures this effect runs only once on component mount

  const onSubmit = async (event) => {
    event.preventDefault();
    try {
      await axios.post("/auth/personal1", {
        id,
        pername,
        quantity,
        price,
        dameg,
      });

      setPername("");
      setQuantity("");
      setPrice("");
      setDameg("");
      setAlertMessage("Data Transferred");
      setAlertType("success");
    } catch (error) {
      setAlertMessage("Error Transferring");
      setAlertType("error");
      console.error(error);
    }
  };

  return (
    <div>
      <div className="data-container">
        <form onSubmit={onSubmit}>
          <Texthome_1 />
          <div className="form-group">
            <label htmlFor="id"></label>
            <input
              type="text"
              name="id"
              placeholder="Id"
              value={id}
              onChange={(event) => setId(event.target.value)}
            />
          </div>
          <div className="form-group">
            <label htmlFor="pername"></label>
            <input
              type="text"
              name="pername"
              placeholder="pername"
              value={pername}
              onChange={(event) => setPername(event.target.value)}
              disabled // Disable editing as it's automatically filled
            />
          </div>
          {/* Remaining input fields */}
          <button className="submit-tp" type="submit">
            Submit
          </button>{" "}
        </form>
      </div>

      {alertMessage && (
        <div className={`alert-all ${alertType} slideIn `}>
          {alertMessage} <br />
        </div>
      )}
    </div>
  );
}
